#include <stdio.h>
#include <stdlib.h>
#include <time.h>

clock_t start, stop;

typedef struct String{
    char* data;
    int len;
}String;

String* initString(){
    String* S = (String*)malloc(sizeof(String));
    S->data = NULL;
    S->len = 0;
    return S;
}

void stringAssign(String* S, char* data){
    if(S->data){
        free(S->data);
    }
    int len = 0;
    char*temp = data;
    while(*temp){
        len++;
        temp++;
    }
    if(len == 0){
        S->data = NULL;
        S->len = 0;
    }
    else{
        S->data = (char*)malloc(sizeof(char) * (len + 1));
        S->len = len;
        temp = data;
        for(int i = 0; i < len; i++){
           S->data[i] = temp[i]; 
        }
    }
}

void printString(String* S){
    for(int i =0 ; i < S->len; i++){
        printf(i == 0 ? "%c " : "->%c ", S->data[i]);
    }
    putchar('\n');
}

int* getNext(String* S){
    int* next = (int *)malloc(sizeof(int) * S->len);
    int i = 0;
    int j = -1;
    next[i] = j;
    while(i < S->len){
        if(j == -1 || S->data[i] == S->data[j]) next[++i] = ++j;
        else j = next[j];
    }
    return next;
}

void printNext(int* next, int len){
    for(int i = 0; i < len; ++i){
        printf(i == 0 ? "%d " : "->%d ", next[i]);
    }
    putchar('\n');
}

void kmpMatch(String* master, String* sub, int* next){
    int i = 0;
    int j = 0;
    while(i < master->len && j < sub->len){
        if(j== -1 ||master->data[i] == sub->data[j]){
            i++;j++;
        }
        else{
            j = next[j];
        }
    }
    if(j == sub->len){
        printf("Kmp match success.\n");
    }
    else{
        printf("Kmp match fail.\n");
    }
}

int main(int argc, char** argv){
    start = clock();
    String* master =  initString();
    String* sub = initString();
    char* c1 = "";
    // stringAssign(master, argv[1]);
    stringAssign(master, c1);
    // printString(master);
    // stringAssign(sub, argv[2]);
    stringAssign(sub, "abcd");
    // printString(sub);
    
    int* next = getNext(sub);
    // printNext(next, sub->len);
    kmpMatch(master, sub, next);
    stop = clock();
    double duration = (stop - start) / CLK_TCK;
    printf("times: %f\n", duration);
    system("pause");
    return 0;
}